function add_events(){const sign_up_norm=document.querySelectorAll("#create_ac_portal"),sign_in_port=document.querySelectorAll("#sign_in_portal"),sign_up_port=document.getElementById("sign_up_port");sign_up_port.addEventListener("click",sign_up_port_func);for(let i=0;i<sign_up_norm.length;i++)sign_up_norm[i].addEventListener("click",sign_up_norm_fuc);for(let i=0;i<sign_in_port.length;i++)sign_in_port[i].addEventListener("click",sign_in_port_fuc);return!1}function sign_up_port_func(e){const to_create_port=document.getElementById("t-4");return to_create_port.click(),!1}function sign_up_norm_fuc(e){const to_sign_up=document.getElementById("t-2");return to_sign_up.click(),!1}function sign_in_port_fuc(e){const sign_in_page=document.getElementById("t-3");return sign_in_page.click(),!1}$(document).ready(()=>{add_events()});